// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

interface TokenInterface {
    function mint(address account, uint256 amount) external;
}

contract Company {
    AggregatorV3Interface internal priceFeed; // variable to store the price feed of the native token ( CHAINLINK USE CASE!!! )
    TokenInterface public token; // variable to store the token contract interface
    string public country; // variable to store the country of the company
    uint256 public allowance; // variable to store the allowance for the company sell OffsetCarbonTokens
    uint256 public tokenPrice; // variable to store the price of the OffSetCarbonToken on this compesation system
    uint256 public carbonCreditsEmmiteds; // variable to store the amount of carbon credits emmiteds by the company
    string public companyName; // variable to store the name of the company
    string public companyType; // variable to store the type of the company
    address public companyOwner; // variable to store the owner of the company
    string public logoURI; // variable to store the logo of the company on IPFS

    /*
    AggregatorV3Interface address Polygon Mumbai Testnet PoS:

    0xd0D5e3DB44DE05E9F294BB0a3bEEaF030DE24Ada
    */

    constructor(
        address _aggregatorV3Interface,
        address tokenAddress,
        string memory _companyName,
        string memory _companyType,
        address _companyOwner,
        string memory _country,
        uint256 _tokenPrice,
        uint256 _carbonCreditsEmmiteds,
        string memory _logoURI
    ) {
        priceFeed = AggregatorV3Interface(_aggregatorV3Interface);
        token = TokenInterface(tokenAddress);
        companyName = _companyName;
        companyType = _companyType;
        companyOwner = _companyOwner;
        country = _country;
        tokenPrice = _tokenPrice;
        carbonCreditsEmmiteds = _carbonCreditsEmmiteds;
        logoURI = _logoURI;
    }

    // modifier to restrict access to the company owner
    modifier onlyCompanyOwner() {
        require(msg.sender == companyOwner);
        _;
    }

    // function to set the allowance of the company if the msg.sender is the company owner
    function setTokenAllowance(uint256 _OffsetCarbonAllowance) public onlyCompanyOwner {
        allowance = _OffsetCarbonAllowance;
    }

    // function to decrease the allowance of the company when a user buys OffsetCarbonTokens
    function decreaseAllowance(uint256 _allowanceSpent) private {
        allowance -= _allowanceSpent;
    }

    // function to get the latest price of the native token in USD (CHAINLINK USE CASE!!!)
    function getLatestPrice() public view returns (int) {
        (, int price, , , ) = priceFeed.latestRoundData();
        return price;
    }

    // function to calculate the amount of tokens to be minted
    function tokenAmount(uint256 amountMatic) public view returns (uint256) {
        uint256 maticUsd = uint256(getLatestPrice());
        uint256 amountUSD = (amountMatic * maticUsd) / 10 ** 18;
        uint256 amountToken = amountUSD / tokenPrice / 10 ** (8 / 2);
        return amountToken;
    }

    // function to buy tokens, sending native tokens to the contract and receiving tokens in return
    receive() external payable {
        uint256 amountToken = tokenAmount(msg.value);
        require(
            amountToken <= allowance,
            "This company does not have enough tokens to carry out this sale operation."
        );
        decreaseAllowance(amountToken);
        token.mint(msg.sender, amountToken);
    }

    // function to withdraw the balance of the contract if the msg.sender is the company owner
    function withdraw() external onlyCompanyOwner {
        payable(companyOwner).transfer(address(this).balance);
    }
}
